import React from 'react';
import ReactDOM from 'react-dom';
const root = document.getElementById('root');

import styled from 'styled-components';

const Header = styled.h1`
    font-size: 4em;
`



function App () { 
    return(<>
        <Header>Hello!</Header>
    </>)
}

ReactDOM.render(<App />, root)
